.lists {
    color: var(--color-heading);
    list-style: none;
    padding-left: 0;
}

.lists--inline .lists__item {
    display: inline-block;
    margin-right: 2rem;
}

.lists--tick {
    list-style-image: url(/0d27fea0602b99012821e2f4e94145bb.svg);
    padding-left: 3rem;
}

.lists--tick .lists__item {
    padding-left: 0.5rem;
    margin-bottom: 1rem;
}

@media screen and (min-width: 1024px) {
    .lists--tick .lists__item {
        padding-left: 0;
    }

