.icon {
    width: 40px;
    height: 40px;
}

.icon--primary {
    fill: var(--color-primary);
}

.icon-container {
    width: 64px;
    height: 64px;
    border-radius: 100%;
    background-color: #f3f6fa;
    display: inline-flex;
    justify-content: center;
    align-items: center;
}

.icon--container--accent {
    background-color: var(--color-accent);
}

.icon--white {
    fill: #fff;
