.btn--streched {
    padding-left: 6rem;
    padding-right: 6rem;
}

.btn--primary {
    background-color: white;
    color: var(--color-heading);
    border: 2px solid var(--color-heading);
}

.btn-block {
    width: 100%;
    display: inline-block;
    transition: background-color 0.5s;
}

.btn--primary:hover {
    color: white;
    background-color: var(--color-heading);
}

.btn--secondary {
    background-color: var(--color-secondary);
    color: white;
}

.btn--fat {
    padding: 2rem 6rem;
    margin-left: 0;
}

@media screen and (min-width: 1024px) {
    .btn {
        font-size: 1.5rem;
    }
}

/* inputs */

.input {
    border-radius: var(--border-radius);
    border: 1px solid var(--color-border);
    color: var(--color-heading);
    font-size: 2rem;
    outline: 0;
    padding: 1.5rem 3.5rem;
}

::placeholder {
    color: #cdcbd7;
}

.input-group {
    border: 1px solid var(--color-border);
    border-radius: var(--border-radius);
    display: flex;
    padding: 0.5rem 0;
}

.input-group .input {
    flex-grow: 1;
    border: 0px;
    padding: 1.5rem 1rem;
    width: 0;
    margin-left: 1rem;
}

.input-group .btn {
    margin: 1px;
}

