    font-style: italic;
    line-height: 1.3;
    columns: var(--color-body-darker);
    align-self: center;
}

.quote__message::before {
    content: open-quote;
}

.quote__message::after {
    content: close-quote;
}

.quote__author {
    font-style: normal;
    font-size: 3rem;
    margin-bottom: 1px;
}

.quote__company {
    font-style: normal;
    color: var(--color-heading);
    opacity: 0.4;
    font-size: 1.5rem;
}

.quote__line {
    position: relative;
    bottom: 10px;
}

