.testimonial {
    padding: 2rem 5rem;
}

.testimonial__container {
    max-width: 1000px;
    margin: 7rem auto;
}

.testimonial__image>img {
    width: 100%;
}

.testimonial__heading {
    line-height: 1;
}

.testimonial__content {
    margin-bottom: 3rem;
}

.testimonial__image {
    position: relative;
}

.testimonial__image>.icon-container {
    position: absolute;
    top: 5px;
    right: -32px;
}

@media screen and (min-width: 768px) {
    .testimonial__image {
        margin: 0;
    }

    .testimonial .quote {
        margin: 5rem 0 0 6rem;
        font-size: 120%;
        line-height: 1.5;
    }
}

/* Callouts */

.callout {
    padding: 4rem 2rem;
    max-height: 200px;
    border-radius: 5px;
}

.callout__container {
    max-width: 80rem;
    margin: 0 auto;
    transform: translateY(100px);
    z-index: 233;
    position: relative;
}

.callout--primary,
.callout__para {
    background-color: var(--color-primary);
    color: white;
}

.callout__para {
    font-weight: light;
    font-size: 1.5rem;
    margin-bottom: 0;
    font-weight: lighter;

}

.callout__header {
    color: white;
    font-size: 3rem;
    margin-top: 0;
    line-height: 1;
}

.callout .btn {
    align-self: center;
    justify-self: center;
    padding: 1.2rem 2rem;
}

.callout__content {
    text-align: center;
}

@media screen and (min-width: 768px) {
    .callout .grid-cols-2 {
        grid-template-columns: 1fr auto;
    }

    .callout__content {
        text-align: left;
    }

    .callout .btn {
        justify-self: start;
    }
}

/* Collapsible */

.collapsible__header {
    display: flex;
    justify-content: space-between;
}

.collapsible__heading {
    margin-top: 0;
    font-size: 1rem;
}

.collapsible__icon {
    transition: transform .5s;
    transform: rotate(-90deg);
}

.collapsible__content {
    max-height: 0;
    overflow: hidden;
    opacity: 0;
    transition: all .5s;

}

.collapsible--expanded .collapsible__content {
    max-height: 100vh;
    overflow: show;
    opacity: 1;

}

.collapsible--expanded .collapsible__icon {
    transform: rotate(0deg);
}



/* Block */
.block {
    --padding-vertical: 3rem;
    padding: var(--padding-vertical) 4rem;
}

.block__header {
    text-align: center;
}

.block--dark {
    background-color: black;
    color: #7b858b;
}

.block__heading {
    margin-top: 0;
    margin-bottom: 2rem;
}

.block--dark .block__heading {
    color: white;
}

.block--skewed--right {
    padding-bottom: calc(var(--padding-vertical)+6rem);
    clip-path: polygon(0% 0%, 100% 0%, 100% 100%, 0% 95%);
}

.block--skewed--right--more {
    padding-bottom: calc(var(--padding-vertical)+6rem);
    clip-path: polygon(0% 0%, 100% 0%, 100% 100%, 0% 85%);

}

.block--skewed--left {
    padding-bottom: calc(var(--padding-vertical) + 6rem);
    clip-path: polygon(0% 0%, 100% 0%, 100% 95%, 0% 100%);
}

.container {
    max-width: 1440px;
    margin: 0 auto;
}

/* Navigation */

.nav {
    background: black;
    display: flex;
    justify-content: space-between;
    flex-wrap: wrap;
    padding: 1rem;

}

.nav__item>a {
    color: grey;
    margin-right: 3rem;
}

.nav__lists {
    margin-top: 0;
    margin-bottom: 0;
    width: 100%;
}

.nav__item {
    font-size: 1.5rem;
    padding-bottom: 5px;
    margin-top: 1rem;
    border-bottom: .5px solid #222;
}

.nav__logo {
    width: auto;
    transform: translateY(-3px);
}

.nav__item>a:hover {
    color: white;
}

.nav.collapsible {
    padding-bottom: 0;
}

@media screen and (min-width:764px) {
    .nav .collapsible__icon {
        display: none;
    }

    .nav__lists {
        display: flex;
        width: auto;
        max-height: 100%;
        opacity: 1;
    }

    .nav__item {
        font-size: 2rem;
        margin-right: 10px;
        border: 0;
    }

}

/* Hero  */


.hero__image {
    width: 100%;
}

.hero__tagline {
    font-size: 1.5rem;
    color: grey;
    letter-spacing: 1px;
    margin: 2rem 0 5rem;
}

@media screen and (min-width: 768px) {
    .hero__content {
        text-align: left;
        align-self: center;
    }

}

.feature {
    margin-bottom: 1rem;
}

.main__heading {
    font-size: 4rem;
}

@media screen and (min-width: 1024px) {
    .hero {
        padding-top: 0;
    }

    .main__heading {
        font-size: 7rem;
    }
}

/* Domain Block  */

.domain-block .input-group {
    box-shadow: 0 0 30px 20px #e6ebee;
    border: 0;
    margin: 4rem auto;
    max-width: 670px;
}

.domain-block__list {
    color: var(--color-headings);
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-template-rows: repeat(2, 6rem);
    font-size: 2rem;
    font-weight: 600;
    justify-items: center;
    max-width: 700px;
    margin: 0 auto;
}

@media screen and (min-width:786px) {
    .domain-block__list {
        grid-template-columns: repeat(auto-fit, minmax(10rem, 1fr));
    }
}

/* Plans  */
.block {
    gap: 3rem;
}

.plan {
    transition: all .2s ease-in-out;
    gap: 7rem;
}

.block .card {
    min-width: 393px;
    max-width: 1000px;
}

.plan:hover {
    transform: scale(105%);
}


@media screen and (min-width:786px) {

    .plan-popular {
        transform: scale(110%);
    }

    .plan-popular:hover {
        transform: scale(115%);
    }

    .plan {
        justify-self: center;
    }

}

/* Features  */

.features__header {
    margin: 1rem 0;
}

.features__content {
    align-self: center;
}

.features__picture {
    align-self: center;
}

.feature:first-of-type {
    margin-top: 7rem;
}

@media screen and (min-width:786px) {
    .feature:nth-of-type(even) .features__content {
        order: 1;
    }
}

/* Showcase  */

.showcase-block__content {
    align-self: center;
}

.showcase-block__content .media__body>h3 {
    color: white;
    line-height: 1;
    font-size: 2rem;
}

.showcase-block__content .media {
    margin-top: 2rem;
    margin-bottom: 2rem;
}

.showcase-block__content .media__body>p {
    font-size: 1.5rem;
}

.showcase-block__picture>img {
    width: 100%;
}

.showcase {
    padding-bottom: 20rem;
}

@media screen and (min-width: 768px) {
    .showcase .grid {
        grid-template-columns: 50% 50%;
    }


    .showcase-block__picture {
        justify-self: end;
    }

    .showcase-block__picture>img {
        width: auto;
        max-width: 700px;
    }
}

/* Footer  */

.footer_clip {
    padding-top: 15rem;
}

.footer {
    max-width: 1000px;

}

footer .collapsible .collapsible__heading {
    color: var(--color-border);
}

footer .collapsible .collapsible__content>ul {
    color: var(--color-body);
}

.lists__item {
    margin-bottom: 1rem;
}

.footer__content {
    border-bottom: 1px solid grey;
    margin-bottom: 1rem;
}

.footer__content .lists {
    margin: 0;
}

.footer__brand {
    text-align: center;
}

.footer__brand>p {
    font-weight: 400;

}

.footer__brand>picture>img {
    width: 100%;
}

.footer a {
    color: #777;
    transition: color 0.3s;
    line-height: 2;
}

.footer a:hover {
    color: #fff;
}



@media screen and (min-width:786px) {


    .footer__heading {
        font-size: 1.5rem;
        margin-bottom: 2rem;
        line-height: 2.5;
        padding-bottom: 0;
    }

    footer .collapsible .collapsible__header>.collapsible__icon {
        display: none;
    }

    footer .collapsible .collapsible__content {
        max-height: 100vh;
        overflow: show;
        opacity: 1;
    }

    .footer__content {
        border-bottom: 0px;
        font-size: 1rem;
        justify-self: end;
    }

    .footer {
        font-size: 1.5rem;
        grid-template-columns: repeat(auto-fit, minmax(10rem, 1fr));

    }

    .footer__brand {
        order: -1;
        font-size: 1.5rem;
        align-self: flex-start;
        justify-self: end;
    }
}

@media screen and (max-width:786px) {

    h1 {
        font-size: 5rem;
        line-height: 5rem;

    }

    h2 {
        line-height: 5rem;

        font-size: 3rem;

    }

    h3 {
        line-height: 5rem;
        font-size: 1.5rem;
    }

    .quote__author {
        line-height: 3rem;
        font-size: 2rem;

    }

    .input-group {
        padding: 0;
    }

    .feature {
        margin-bottom: 5rem;
    }

    .features__header {}

    p {
        font-size: 1.5rem;
        font-weight: 400;
    }


    .testimonial__container {
        max-width: 400px;
    }

    .callout__container {
        max-width: 400px;
    }


}

